import React from 'react';
import {
    Container,
    Form,
    FormControl,
    Button
} from 'react-bootstrap/';

const Search = () => (
    <Container fluid>
        <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <Button variant="outline-success">Search</Button>
        </Form>
    </Container>




)

export default Search;
